 @duartemaia4880  , e contra o Bahia? Teve dois gols legais e anularam, e a CBF nada fez .
Jogo de hj, os jogadores do Athletico caíam e o juizão dava falta,  já pro Cuiabá era difícil, sendo q eram lances parecidos. Teve um lance de possível pênalti, juiz sequer consultou o VAR.

O do Palmeiras foi mérito deles mesmo, mereceram a vitoria.

