Fiquei com uma puta raiva do Palmeiras reserva perder aquele jogo contra o SPFC. Com 3 pontos a menos estaria com sério risco de rebaixamento.
O Cuiabá vai pegar 2 pedreiras o Fortaleza que luta pelo 4° Lugar e o Santos que visa vaga para Pré Libertadores.

 @mauricio2818  corinthians só entrega se for comprado
Caso contrário somente a ruindade deles pra perder, pq a torcida vai vaiar até o fim o grêmio e o time já ta descansado e se preparando enquanto o do grêmio teve apenas hoje e amanhã como dias livres
Fora que o corinthians tem motivos pra ganhar essa partida, a torcida do grêmio zoou eles quando caíram em 2007
